#!/bin/sh
# Name: Toggle SSH/USBNet
# Author: Darkwhite
# DontUseFBInk
# Icon: data:image/png;base64,

# -------------------------------------------------------------------

# **FIXED PATH**: Using the specific binary path for the 'usbnetlite' hack.
# This binary handles the device-specific logic and permissions for toggling.

# Optional: Log the execution attempt.
mkdir -p /mnt/us/log
echo "--- $(date) ---" >> /mnt/us/log/usbnet_toggle.log
echo "Starting toggle attempt (Using /mnt/us/usbnetlite/bin/usbnetwork)." >> /mnt/us/log/usbnet_toggle.log

# Primary Action: Call the USBNetLite hack's own toggle binary.
/mnt/us/usbnetlite/bin/usbnetwork

echo "Toggle attempt finished." >> /mnt/us/log/usbnet_toggle.log